import React from 'react';
import { Header, Row, Container } from '../../shared';
import { ShoppingBag } from '@styled-icons/boxicons-regular';

const NavigationBar = () => {
  return (
    <Header>
      <Row>
        <div>
          <img src="#" alt="logo" />
        </div>
        <div>
          <ul>
            <li>
              <a href="#">SHOP</a>
            </li>
            <li>
              <a href="#">CONTACT</a>
            </li>
            <li>
              <a href="#">SIGN IN</a>
            </li>
            <li>
              <a href="#">
                <ShoppingBag size="20" title="Shopping Bag" />
              </a>
            </li>
          </ul>
        </div>
      </Row>
    </Header>
  );
};

export default NavigationBar;
